package org.springframework.samples.petclinic.vet;

import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.DisplayName;
import org.junit.jupiter.api.extension.ExtendWith;
import org.mockito.InjectMocks;
import org.mockito.Mock;
import org.mockito.junit.jupiter.MockitoExtension;
import static org.junit.jupiter.api.Assertions.*;
import static org.mockito.Mockito.*;
import static org.mockito.ArgumentMatchers.*;
import java.util.*;
import org.mockito.Mockito;
import org.springframework.data.domain.Page;
import org.springframework.data.domain.PageImpl;
import org.springframework.data.domain.PageRequest;
import org.springframework.data.domain.Pageable;
import org.springframework.ui.Model;
import org.springframework.web.bind.WebDataBinder;
import org.springframework.web.servlet.mvc.support.RedirectAttributes;
import org.springframework.validation.BindingResult;

@ExtendWith(MockitoExtension.class)
class VetTest {

    @InjectMocks
    private Vet controller;

    @Test
    @DisplayName("should return new HashSet when specialties is null")
    void getSpecialtiesInternal_null_specialties() {
        Vet controller = new Vet();

        var result = controller.getSpecialtiesInternal();

        assertEquals(0, result.size());
    }

    @Test
    @DisplayName("should return the existing set when specialties is set")
    void getSpecialtiesInternal_with_specialties() {
        Vet controller = new Vet();
        Specialty specialty = new Specialty();
        specialty.setName("cardiology");
        controller.addSpecialty(specialty);

        var result = controller.getSpecialtiesInternal();

        assertEquals(1, result.size());
    }

    @Test
    @DisplayName("should return empty list when no specialties")
    void getSpecialties_empty() {
        Vet controller = new Vet();

        var result = controller.getSpecialties();

        assertEquals(0, result.size());
    }

    @Test
    @DisplayName("should return sorted list by name when specialties exist")
    void getSpecialties_with_specialties_sorted() {
        Vet controller = new Vet();
        Specialty s1 = new Specialty();
        s1.setName("b");
        Specialty s2 = new Specialty();
        s2.setName("a");
        controller.addSpecialty(s1);
        controller.addSpecialty(s2);

        var result = controller.getSpecialties();

        assertEquals(2, result.size());
        assertEquals("a", result.get(0).getName());
        assertEquals("b", result.get(1).getName());
    }

    @Test
    @DisplayName("should return 0 when no specialties")
    void getNrOfSpecialties_zero() {
        Vet controller = new Vet();

        var result = controller.getNrOfSpecialties();

        assertEquals(0, result);
    }

    @Test
    @DisplayName("should return count when specialties exist")
    void getNrOfSpecialties_with_specialties() {
        Vet controller = new Vet();
        Specialty s1 = new Specialty();
        s1.setName("cardiology");
        Specialty s2 = new Specialty();
        s2.setName("surgery");
        controller.addSpecialty(s1);
        controller.addSpecialty(s2);

        var result = controller.getNrOfSpecialties();

        assertEquals(2, result);
    }

    @Test
    @DisplayName("should add specialty to the set")
    void addSpecialty_new_specialty() {
        Vet controller = new Vet();
        Specialty specialty = new Specialty();
        specialty.setName("surgery");

        controller.addSpecialty(specialty);

        assertEquals(1, controller.getNrOfSpecialties());
    }

    @Test
    @DisplayName("should not add duplicate specialty")
    void addSpecialty_duplicate_specialty() {
        Vet controller = new Vet();
        Specialty specialty = new Specialty();
        specialty.setName("surgery");
        controller.addSpecialty(specialty);

        controller.addSpecialty(specialty);

        assertEquals(1, controller.getNrOfSpecialties());
    }

}
